import React from 'react';

const RemedyDetails = ({ remedyData }) => {
    re
  return (
    <div>
      <h2>Diagnosis: {remedyData.Diagnosis}</h2>
      <h3>How to prepare it:</h3>
      <ul>
        {remedyData['How to prepare it'].map((step, index) => (
          <li key={index}>{step}</li>
        ))}
      </ul>
      <h3>What to eat:</h3>
      <ul>
        {remedyData['What to eat'].map((food, index) => (
          <li key={index}>{food}</li>
        ))}
      </ul>
      <h3>When to eat:</h3>
      <ul>
        {remedyData['When to eat'].map((timing, index) => (
          <li key={index}>{timing}</li>
        ))}
      </ul>
    </div>
  );
};

export default RemedyDetails;
